pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Both Parties shall co-operate to procure and ensure that the registration takes place as soon as is reasonably practical.&nbsp;</span></p><br><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">6.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp; </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">TERMINATION AND RESCISSION</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">6.1 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Either party being ready and able to complete shall be entitled to terminate this Agreement for Sale on the breach or failure of the other party in complying with or performing obligations in accordance with this Agreement for Sale and the Law Society Conditions applicable to the same.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">6.2 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Termination shall be by notice in writing to the party in breach or default specifying the breach or default&nbsp; and allowing the other party a period of not less than </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Twenty one (21)</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> days from the date of the notice (which shall be referred to as \"</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">the Completion Notice</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\") to rectify the breach or default&nbsp; and where the party in breach or default fails to rectify the same within </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Twenty one (21)</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> days&nbsp; from the date of the service of such a notice or such longer period specified therein or subsequently extended by notice, then this Agreement for Sale for Sale shall terminate and stand rescinded upon the expiry of that period without the necessity of issuance of a rescission notice.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">6.3 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Upon the termination of this Agreement for Sale by the Purchaser due to breach on the part of the Vendor and provided that the Purchaser shall by then be ready, able and willing to&nbsp; complete&nbsp; in&nbsp; accordance&nbsp; with&nbsp; the terms and conditions of this Agreement for Sale and provided further that the requisite and proper Completion Notice shall have been issued and served by the Purchaser upon the Vendor, then the Vendor shall refund to the Purchaser’s Advocates all monies that have been paid hereunder towards the Purchase Price, without the necessity of the Purchaser issuing a rescission notice to the Vendor. Under Clause 6.3 of the Agreement for Sale, the refundable monies that remain unpaid to the Purchaser from the date of rescission and/or expiry of the Completion Notice will attract interest from the date of default until the full settlement of the refundable amounts by the Vendor to the Purchaser (</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">both dates inclusive</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">).&nbsp; The Purchaser’s Advocates shall be obligated to immediately (within two days of termination and/or rescission of the Agreement) return to the Vendor’s Advocates all original documents of title and other completion documents in their possession (</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">if any</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">) belonging to the Vendor subject to the confirmation that the Vendor has fully refunded the Purchaser the balance of the purchase price as hereunder including all such interest that will have accrued thus far. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">6.4 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Upon the termination of this Agreement for Sale by the Vendor due to breach or default on the part of the Purchaser and provided that the Vendor shall by then be ready, able and willing to complete in accordance with the terms and conditions of this Agreement for Sale and provided further that the requisite and proper Completion Notice shall have been issued and served by the Vendor upon the Purchaser, then the Purchaser shall forfeit absolutely a deposit of 10% in respect of the purchase price&nbsp; that will have been paid being the agreed liquidated and only damages due to the Vendor for the Purchaser’s breach of the contract comprised in the Agreement for Sale without the necessity of the Vendor issuing a rescission notice to the Purchaser. The Purchaser’s Advocates shall be obligated to immediately (within two days of termination and/or rescission of the Agreement) return to the Vendor’s Advocates all original documents of title and other completion documents in their possession belonging to the Vendor subject to the confirmation that the Vendor has fully refunded the Purchaser the balance of the purchase price as hereunder including all such interest that will have accrued thus far. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">7. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">TIME</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:10.25pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Time shall be of the essence in respect in this Agreement for Sale and specifically in respect of the Completion Date.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:20.2pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">8. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">CONDITION OF PROPERTY</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Purchaser having been given an opportunity of examining the said property prior to the date of this Agreement for Sale and will purchase the same in the same condition that it is now and shall not require the Vendor to repair or improve the same and point out or replace the beacons.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:15pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">9.&nbsp; </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">CONSENTS &amp; CLEARANCES</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor shall at its own cost and expense and in accordance with Clause 4.2 hereinbefore obtain all the consents and clearances and the discharge of charge requisite to the completion of this Agreement for Sale and the Purchaser shall bear the cost of the registration of the Transfer in its favour.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">11.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">POSSESSION</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor shall immediately deliver the property unto the Purchaser in vacant possession upon receipt of the purchase price in cleared funds.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:15.15pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp; </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">WARRANTIES</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:2.045;margin-left: 35.25pt;margin-right: 63.05pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor represents warrants and undertakes to the Purchaser that:-&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;margin-right: 63.05pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.1 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">As the registered owner of the Property he holds a clear and valid title.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.2 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">There is no law or decree or similar enactment binding on them so far as it is aware which would conflict with or prevent them from entering into or performing and observing the terms of this Agreement;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.3 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor has not given any rights of way, easement or any overriding interests and has no intentions of so doing;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.4 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor is the sole owner of the Property and that they have the legal capacity and unencumbered right to dispose of the said Property;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.5 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor has the power to enter and perform this Agreement and has taken all necessary action to authorize the execution, delivery and performance of this Agreement and all other documents and instruments to be executed, delivered and performed by them in accordance with their terms;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.6 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">No other Deposits on the said Property have been received or made;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.7 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor has to the best of its knowledge disclosed to the Purchaser all material information relating to the Property;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.8 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor has not received any notice from the Government or Municipal Authority or from the owners of adjoining properties which remains to be complied with and has disclosed any and all such notices received to the Purchaser; and,&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.9 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Vendor and the Purchaser hereby represent, warrant and undertake to each other that this Agreement for Sale constitutes a legal, valid and binding agreement setting out their obligations to one another and enforceable as against each of them in accordance with the terms and conditions set out herein.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -36pt;text-align: justify;margin-top:0pt;margin-bottom:4.85pt;padding:0pt 0pt 0pt 36pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">12.10 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Each parties hereby agrees and confirms for the purpose of the Land Act (No. 6 of 2012, Laws of Kenya) and the Law of Contract (CAP 23 Laws of Kenya) and that they have executed this Agreement for Sale with the intention to bind themselves to the contents thereof.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 72pt;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: 17.75pt;margin-right: -0.75pt;text-indent: -0.75pt;margin-top:0pt;margin-bottom:15.9pt;padding:0pt 0pt 0pt 0.75pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">13. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">FORCE MAJEURE</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Neither the Vendor nor the Purchaser will be liable in respect of any delay in performing, failure to perform, or failure to adequately perform any of their obligations hereunder (other than the obligations of the parties to make payment to each other in accordance with this agreement) in consequence of any act, cause or event which (i) was not within the control of the affected party, (ii) was not caused or precipitated by such party’s negligence, and (iii) could not have been prevented by the affected party’s reasonable diligence, including without limitation:&nbsp;</span></p><ol style=\"margin-bottom: 0px; padding-inline-start: 48px;\"><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any act of God;&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any war or hostilities (whether war be declared or not);&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any sabotage, riots or other act of civil disobedience, civil commotion, rebellion, act of a public enemy or invasions;&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any judicial actions, strikes, lockouts, industrial disputes or actions of any such nature;&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any actions or inactions of any government or any agency or subdivision thereof;&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:5.9pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any non-performance of its obligations by any third party contracted with by the&nbsp;</span></p></li></ol><p dir=\"ltr\" style=\"line-height:1.2;margin-left: 72.5pt;text-indent: 35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Vendor in connection with its obligations under this agreement;&nbsp;</span></p><ol style=\"margin-bottom: 0px; padding-inline-start: 48px;\" start=\"7\"><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any act of terror;&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">any storms, floods or other inclement weather, earthquakes, subsidence, epidemics or other natural physical disasters; and&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt; padding-left: 18pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">fire, accident, explosion, or shortage of labour.&nbsp;</span></p></li></ol><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The party affected by any of the circumstances referred to in this clause (the “Force Majeure Event(s)”) shall promptly notify the other party (the “Force Majeure Notice”) when such circumstances cause a delay in performance, failure in performance or failure in adequate performance and when they cease so to do.&nbsp; If such circumstances continue for more than six (6) months after the date of the Force Majeure Notice, either party may terminate this agreement by notice in writing to the other, whereupon the Vendor shall repay to the Purchasers any payments made on account of the Purchase Price as shall have been paid pursuant to this agreement without interest or any deductions whatsoever and the Purchasers shall return to the Vendor all papers belonging to the Vendor (if any), but without prejudice to any accrued rights either party may have against the other but subject to agreement, such affected party undertakes to continue with its performance of obligations under this agreement immediately the Force Majeure Event ceases. It is understood by the parties that either party affected by Force Majeure shall take such necessary steps (if any) to remedy the situation within a reasonable time depending on the event constituting the Force Majeure.&nbsp;&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">14.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">SURVIVAL</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=