one; vertical-align: baseline; white-space: pre-wrap;\">WAIVER</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:10.85pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">No failure or delay by the Vendor or the Purchaser in exercising any claim, remedy, right, power and privilege under this Agreement shall operate as a waiver nor shall any single or partial exercise of any claim, remedy, right, power or privilege preclude any further exercise thereof or the exercise of any other claim, right or power.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">16.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> &nbsp; &nbsp; &nbsp; &nbsp; </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">REMEDIES CUMULATIVE</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:10.85pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Any remedy or right conferred upon the Vendor or the Purchaser for breach of this Agreement including the right of rescission shall be in addition to and without prejudice to all other rights and remedies available to them.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">17.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">ENTIRE AGREEMENT</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-indent: -0.5pt;text-align: justify;margin-top:0pt;margin-bottom:10.85pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">This Agreement contains the whole agreement and understanding between the Vendor and the Purchaser relating to the transaction provided for in this Agreement for Sale and supersedes all previous agreements (if any) whether written or oral between the parties in respect of such matters.&nbsp;</span></p><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">18.</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">VARIATION</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><ol style=\"margin-bottom: 0px; padding-inline-start: 48px;\"><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.535;text-align: justify;margin-top:0pt;margin-bottom:10.85pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">No variation of this Agreement for Sale shall be valid or effective unless such variation shall have been made in writing and signed by both the Vendor and the Purchaser or their respective Advocates provided always that the expression “variation” shall include any variation, supplement, deleting, amendment or replacement, however effected.&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type: lower-alpha; font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: 17.25pt;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.535;text-align: justify;margin-top:0pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Any reference to an obligation imposed upon a Party by this Agreement for Sale and the Law Society conditions includes reference to any obligation undertaken or intended to be undertaken by the Party’s Advocates on the party’s behalf.&nbsp;</span></p></li></ol><h1 dir=\"ltr\" style=\"line-height:1.2300000000000002;margin-left: -0.75pt;margin-right: -0.75pt;text-indent: -0.5pt;margin-top:0pt;margin-bottom:10.7pt;padding:0pt 0pt 0pt 0.5pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">19. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">NOTICES</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></h1><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Any notice, request or demand required or permitted to be given, made or served under this Agreement for Sale shall be in writing and shall be deemed to have been duly given, made or served when addressed and sent by registered postage to the postal address of the firm of Advocates acting for and on behalf of the recipient party as contained in this Agreement for Sale or whose change is subsequently notified to the other party’s Advocates in writing or alternatively delivered by hand to the recipient party’s Advocates address aforesaid and duly acknowledged by stamping on a counter-part copy thereof. Any notice, request or demand sent by registered postage shall be deemed to have been made, served and received within </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Ten (10) days</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> from the date of being sent by registered postage as evidenced by the registered postage receipt issued by the postal service thereof.</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">20. </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">ARBITRATION</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;margin-left: 35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Should any dispute arise between the parties hereto with regard to the interpretation, rights, obligations and/or implementation of any one or more of the provisions of this Agreement then, the Parties to such dispute shall in the first instance attempt to resolve such dispute by amicable negotiations and should such negotiations fail to achieve a resolution within </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Fifteen (15) days </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">then either Party may declare a dispute by written notification to the other, whereupon such dispute shall be referred to arbitration under the following terms:&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 35.25pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">20.1</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> Such arbitration shall be resolved under provisions of the Kenya Arbitration Act (Act No. 4 of 1995) (as amended from time to time);&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 35.25pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">20.2 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Tribunal shall consist of One (1) Arbitrator to be agreed upon between the Parties failing which within a period of Fourteen (14) days from the date of written request by either party to concur in the appointment of an Arbitrator, then such Arbitrator shall be appointed by the Registrar for the time being of the Nairobi Centre for International Arbitration (NCIA) upon the application of either Party;&nbsp;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 35.25pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">20.3 </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The place and seat of arbitration shall be Nairobi and the language of arbitration shall be English;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 35.25pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">20.4</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> The award of the arbitration tribunal shall be final and binding upon the Parties to the extent permitted by law and any Party may apply to a Court of competent jurisdiction for enforcement of such award.&nbsp; The award of the arbitration tribunal may take the form of an order to pay an amount or to perform or to prohibit certain activities; and&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.535;text-indent: -35.25pt;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;padding:0pt 0pt 0pt 35.25pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">20.5</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Notwithstanding the above provisions of this clause, a party is entitled to seek preliminary injunctive reliefs or interim or conservatory measures from any Court of competent jurisdiction pending the final decision or award of the Arbitrator.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;text-align: justify;margin-top:0pt;margin-bottom:15.3pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">22. </span><span style=\"font-size: 11pt; fon