lign: baseline; white-space: pre-wrap;\"> that the above-named deponent appeared before me on the ……………. day of …………… 20</span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp; &nbsp; &nbsp; </span><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;and (being known to me/being identified by ………………………………………….) acknowledged the above signature or mark to be his/hers and that he/she had freely and voluntarily executed this instrument and understood its contents.</span></p><br><br><br><br><p dir=\"ltr\" style=\"line-height:1.2;text-indent: 35.25pt;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">…………………………………………………..</span></p><p dir=\"ltr\" style=\"line-height:1.2;text-indent: 35.25pt;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: &quot;Book Antiqua&quot;, serif; color: rgb(0, 0, 0); background-color: transparent; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Commissioner for Oaths’ signature</span></p><br></td></tr></tbody></table></div><br><br><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p><div><br></div></span></div><div style=\"display: flex; flex-direction: column;\">\n</div>', 0);
